import React, {Component} from "react";

class Dashboard extends Component{
  render() {
    return (
      <div>
        <h3 className="center">Your Timeline</h3>
        <ul className="dashbord-list">
          {this.props.tweetsIds.map(id => (
            <li key={id}>
              {/* <div>TWEET ID: {id} </div> */}
              <Tweet id={id} />
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default Dashboard;
